const AWS = require('aws-sdk');
const crypto = require("crypto");

const BUCKET = process.env.BUCKET || 'loimg';
const CDN = process.env.CDN || 'https://s.loudyo.com';
const region = process.env.REGION || 'eu-central-1';

function getValueIgnoringKeyCase(object, key) {
    const foundKey = Object
    .keys(object)
    .find(currentKey => currentKey.toLocaleLowerCase() === key.toLowerCase());
    return object[foundKey];
}

function getBoundary(event) {
    return getValueIgnoringKeyCase(event.headers, 'Content-Type').split('=')[1];
}

function getBody(event) {
    if (event.isBase64Encoded) {
        return Buffer.from(event.body, 'base64').toString('binary');
    }
    return event.body;
}

function parse(event) {
    const boundary = getBoundary(event);
    const result = {};
    getBody(event)
    .split(boundary)
    .forEach(item => {
        if (/filename=".+"/g.test(item)) {
            result[item.match(/name=".+";/g)[0].slice(6, -2)] = {
                type: 'file',
                filename: item.match(/filename=".+"/g)[0].slice(10, -1),
                contentType: item.match(/Content-Type:\s.+/g)[0].slice(14),
                content: Buffer.from(item.slice(item.search(/Content-Type:\s.+/g) + item.match(/Content-Type:\s.+/g)[0].length + 4, -4), 'binary'),
            };
        } else if (/name=".+"/g.test(item)){
            result[item.match(/name=".+"/g)[0].slice(6, -1)] = item.slice(item.search(/name=".+"/g) + item.match(/name=".+"/g)[0].length + 4, -4);
        }
    });
    return result;
}

exports.handler = async (event) => {
    console.log('asdf', event);
    const ddb = new AWS.DynamoDB.DocumentClient({region});
    const s3 = new AWS.S3();
    const Key = `${crypto.randomBytes(16).toString("hex")}.jpg`;
    const { pathParameters } = event;
    const { file } = parse(event)

    const params = {
        TableName: 'tracks',
        Key: { id: pathParameters.id },
        UpdateExpression: 'set artwork_url = :a',
        ExpressionAttributeValues: {
            ':a': `${CDN}/${Key}`,
        }
    };
    try {
        await s3.putObject({
            Key,
            Body: file.content,
            ACL: 'public-read',
            Bucket: BUCKET,
            ContentType: 'image/jpeg'
        }).promise();

        const res = await ddb.update(params).promise();
        console.log('Success: ', res);
        return {
            statusCode: 200,
            headers: {
                "Access-Control-Allow-Headers" : "Content-Type",
                "Access-Control-Allow-Origin": "*",
                "Access-Control-Allow-Methods": "OPTIONS,PUT"
            },
            body: "",
            isBase64Encoded: false
        }

    } catch (e) {
        console.log('Error: ', e)
        return {
            statusCode: 400,
            headers: {
                "Access-Control-Allow-Headers" : "Content-Type",
                "Access-Control-Allow-Origin": "*",
                "Access-Control-Allow-Methods": "OPTIONS,PUT"
            },
            body: "",
            isBase64Encoded: false
        }
    }
};

